import styled from "styled-components";
import { PersistentDrawerLeft } from "../commons/persistentDrawer";
import { PersistentDrawerMainContent } from "../commons/persistentDrawerMainContent";
import { Sidemenu } from "../commons/sidemenu";

const MainTemplate: React.FC<MainTemplateProps> = (props) => {
  return (
    <StyledMainTemplate>
      <PersistentDrawerLeft
        sidemenu={<Sidemenu />}
        mainContent={<PersistentDrawerMainContent />}
      />
      {props.title}
    </StyledMainTemplate>
  );
};
export type MainTemplateProps = {
  title: string;
};

const StyledMainTemplate = styled.div`
  background: #fffacd;
  height: 1700px;
  width: 700px;
  margin-left: auto;
  margin-right: auto;
`;

export default MainTemplate;
